import React from 'react';

const styles = {
  card: {
    fontSize: '28px',
    padding: '10px 50px 0 50px',
  },
}

export default function Portfolio() {
  return (
    <div class='container'>
      <div class="card">
        <img src="https://picsum.photos/200/300" alt="project 1" />
      </div>
    </div>
  );
}
